<p>–Ø –∏—â—É —Ö—É–¥–µ–Ω—å–∫—É—é –∂–µ–Ω—â–∏–Ω—É –∏–∑ –õ–î–ù–†. –Ø –∏—â—É –¥–µ–≤—É—à–∫—É –¥–ª—è —Å–µ—Ä—å–µ–∑–Ω—ã—Ö –æ—Ç–Ω–æ—à–µ–Ω–∏–π –Ø –±—Ä—é–Ω–µ—Ç —Å –∫–∞—Ä–∏–º–∏ –≥–ª–∞–∑–∞–º–∏. –Ø –∏—â—É —Ç–∞–∫–∏—Ö –∫–∞–∫ —è, —Å—É–º–∞—Å—à–µ–¥—à–∏—Ö –∏ —Å–º–µ—à–Ω—ã—Ö –Ø —Ö–æ—á—É, –Ω–∏—á–µ–≥–æ –Ω–µ —Ö–æ—Ç–µ—Ç—å. –Ø –∏—â—É –¥–æ–±—Ä—É—é, –≤–µ—Å—ë–ª—É—é —Å–ø—É—Ç–Ω–∏—Ü—É –≤ —ç—Ç–æ–π –∂–∏–∑–Ω–∏ –Ø –ø–æ—Ä—è–¥–æ—á–Ω—ã–π, –≤–µ—Å—ë–ª—ã–π, —á–µ—Å–Ω—ã–π. –Ø –∏—â—É –º—É–∂—á–∏–Ω—É –º–æ–µ–≥–æ –≤–æ–∑—Ä–∞—Å—Ç–∞, –≥–æ–¥–∞ , –¥–ª—è –ø—Ä–æ–∂–∏–≤–∞–Ω–∏—è –Ω–∞ –º–æ–µ–π —Ç–µ—Ä—Ä–∏—Ç–æ—Ä–∏–∏, —Å–∫—Ä–∞—Å–∏—Ç—å –Ω–∞—à—É –Ø –∏—â—É —Ö–æ—Ä–æ—à—É—é,–¥–æ–±—Ä—É—é,–ø–æ–Ω–∏–º–∞—é—â—É—é,–∞ —Å–∞–º–æ–µ –≥–ª–∞–≤–Ω–æ–µ –Ω–µ –∏–∑–º–µ–Ω—è—é—â—É—é.</p>
