<p>–°—Ç–∞—Ä–∞–π—Ç–µ—Å—å –º–∞–∫—Å–∏–º–∞–ª—å–Ω–æ —á–µ—Ç–∫–æ –∏ –≥—Ä–∞–º–æ—Ç–Ω–æ —Ñ–æ—Ä–º—É–ª–∏—Ä–æ–≤–∞—Ç—å –æ–ø–∏—Å–∞–Ω–∏–µ –∫ –æ–±—ä—è–≤–ª–µ–Ω–∏—é, –ø–æ–¥–æ–±—Ä–∞—Ç—å –Ω–∞–∏–±–æ–ª–µ–µ —É–¥–∞—á–Ω—ã–µ —Ñ–æ—Ç–æ, –ø–æ—Å–º–æ—Ç—Ä–µ—Ç—å –¥—Ä—É–≥–∏–µ –æ–±—ä—è–≤–ª–µ–Ω–∏—è –≤ –ò—Ä–ø–µ–Ω—å –æ –ø—Ä–æ–¥–∞–∂–µ –∞–Ω–∞–ª–æ–≥–∏—á–Ω–æ–≥–æ –∏–ª–∏ –ø–æ—Ö–æ–∂–µ–≥–æ –Ω–∞ –≤–∞—à —Ç–æ–≤–∞—Ä, —á—Ç–æ–±—ã –≤—ã–±—Ä–∞—Ç—å –æ–ø—Ç–∏–º–∞–ª—å–Ω—É—é —Ü–µ–Ω—É –¥–ª—è –±—ã—Å—Ç—Ä–æ–π –ø—Ä–æ–¥–∞–∂–∏. –û–±—Ä–∞—Ç–∏—Ç–µ –≤–Ω–∏–º–∞–Ω–∏–µ –Ω–∞ –ø—Ä–∞–≤–∏–ª—å–Ω—ã–π –≤—ã–±–æ—Ä —Ä—É–±—Ä–∏–∫ —á—Ç–æ–±—ã —Ä–∞–∑–º–µ—Å—Ç–∏—Ç—å –æ–±—ä—è–≤–ª–µ–Ω–∏–µ –±–µ–∑ –ø–æ—Ç–µ—Ä–∏ –ª–∏—à–Ω–µ–≥–æ –≤—Ä–µ–º–µ–Ω–∏ –Ω–∞ –µ–≥–æ –ø–æ—Å–ª–µ–¥—É—é—â–µ–µ —Ä–µ–¥–∞–∫—Ç–∏—Ä–æ–≤–∞–Ω–∏–µ. –ï—Å–ª–∏ –í—ã —É–∂–µ –æ–∑–Ω–∞–∫–æ–º–∏–ª–∏—Å—å —Å –ø—Ä–∞–≤–∏–ª–∞–º–∏, —Ç–æ –º–æ–∂–µ—Ç–µ –ø–æ–¥–∞—Ç—å –æ–±—ä—è–≤–ª–µ–Ω–∏–µ –≤ –ò—Ä–ø–µ–Ω—å –ø—Ä—è–º–æ —Å–µ–π—á–∞—Å.</p><strong><a id='m1'></a><h2>–ì–æ—Ä–æ–¥ –ò—Ä–ø–µ–Ω—å. –ó–Ω–∞–∫–æ–º—Å—Ç–≤–∞</h2></strong><p>–ò—Å–ø–æ–ª—å–∑–æ–≤–∞–Ω–∏–µ —Å–∞–π—Ç–∞, –≤ —Ç–æ–º —á–∏—Å–ª–µ –ø–æ–¥–∞—á–∞ –æ–±—ä—è–≤–ª–µ–Ω–∏–π, –æ–∑–Ω–∞—á–∞–µ—Ç —Å–æ–≥–ª–∞—Å–∏–µ —Å –ø–æ–ª—å–∑–æ–≤–∞—Ç–µ–ª—å—Å–∫–∏–º —Å–æ–≥–ª–∞—à–µ–Ω–∏–µ–º –∏ –ø–æ–ª–∏—Ç–∏–∫–æ–π –∫–æ–Ω—Ñ–∏–¥–µ—Ü–∏–∞–ª—å–Ω–æ—Å—Ç–∏. –û–ø–ª–∞—á–∏–≤–∞—è —É—Å–ª—É–≥–∏ –Ω–∞ —Å–∞–π—Ç–µ, –≤—ã –ø—Ä–∏–Ω–∏–º–∞–µ—Ç–µ –æ—Ñ–µ—Ä—Ç—É. –ò–Ω—Å—Ç—Ä—É–∫—Ü–∏—è –æ–ø–ª–∞—Ç—ã. –†–µ–≥–∏—Å—Ç—Ä–∞—Ü–∏—è –Ω–∞ Leboard. –í–∞—à–µ –∏–º—è:. –ö–∞–∫ –∫ –≤–∞–º –æ–±—Ä–∞—â–∞—Ç—å—Å—è: –ì–æ—Å–ø–æ–¥–∏–Ω –ì–æ—Å–ø–æ–∂–∞. –í–∞—à–∞ —ç–ª–µ–∫—Ç—Ä–æ–Ω–Ω–∞—è –ø–æ—á—Ç–∞:. –í–∞—à –¥–∞—Ç–∞ —Ä–æ–∂–¥–µ–Ω–∏—è: 1 –Ø–Ω–≤–∞—Ä—å  –ü—Ä–∏–¥—É–º–∞–π—Ç–µ –ø–∞—Ä–æ–ª—å:. –°–µ—Ä–≤–∏—Å –ø—Ä–µ–¥–Ω–∞–∑–Ω–∞—á–µ–Ω –¥–ª—è –ª–∏—Ü, –¥–æ—Å—Ç–∏–≥—à–∏—Ö —Å–æ–≤–µ—Ä—à–µ–Ω–Ω–æ–ª–µ—Ç–∏—è. –ü—Ä–æ–¥–æ–ª–∂–∞—è, –≤—ã –ø–æ–¥—Ç–≤–µ—Ä–∂–¥–∞–µ—Ç–µ —Å–≤–æ—ë —Å–æ–≥–ª–∞—Å–∏–µ —Å —É—Å–ª–æ–≤–∏—è–º–∏ –ø–æ–ª—å–∑–æ–≤–∞—Ç–µ–ª—å—Å–∫–æ–≥–æ —Å–æ–≥–ª–∞—à–µ–Ω–∏—è. –£–∂–µ –∑–∞—Ä–µ–≥–∏—Å—Ç—Ä–∏—Ä–æ–≤–∞–Ω—ã? –í—Ö–æ–¥ –Ω–∞ Leboard. –≠–ª–µ–∫—Ç—Ä–æ–Ω–Ω–∞—è –ø–æ—á—Ç–∞:. –í–ø–µ—Ä–≤—ã–µ –∑–¥–µ—Å—å? –ó–∞–±—ã–ª–∏