<p>–ú—ñ—Å—Ü–µ –∑—É—Å—Ç—Ä—ñ—á—ñ: –Ü—Ä–ø—ñ–Ω—Å—å–∫–∞ –Ω–∞–±–µ—Ä–µ–∂–Ω–∞ –±—ñ–ª—è –º–æ—Å—Ç—É - 1 —Å–µ—Ä–ø–Ω—è –ë–ª–∞–≥–æ–¥—ñ–π–Ω–∏–π –≤–Ω–µ—Å–æ–∫ - –≥—Ä–Ω. –ê –≤–∏ –∑–Ω–∞–ª–∏? –ù–∞—à–∞ –Ñ–≤–≥–µ–Ω—ñ—è üíï. –î–ª—è —Ç–µ—Ö, –∫—Ç–æ –µ—â–µ –Ω–µ –≤ –∫—É—Ä—Å–µ, –≤ –º–æ–µ–π –∂–∏–∑–Ω–∏ –µ—Å—Ç—å –æ–¥–Ω–∞ —Å–ª–∞–±–æ—Å—Ç—å –∏ —Å—Ç—Ä–∞—Å—Ç—å –æ–¥–Ω–æ–≤—Ä–µ–º–µ–Ω–Ω–æ - –∏–≥—Ä–∞.</p><strong><a id='m4'></a><h2>–ü–µ—Ä—à—ñ –ü—Ä–µ–º—ñ—É–º –ó–Ω–∞–π–æ–º—Å—Ç–≤–∞ –Ü—Ä–ø—ñ–Ω—å (–ö–∏—ó–≤—Å—å–∫–∞ –æ–±–ª–∞—Å—Ç—å)</h2></strong><p>–¶–µ–ª—å - –ø—Ä–∏–º–µ—Ä–∏—Ç—å —Ä–∞–∑–Ω—ã–µ –∞–º–ø–ª—É–∞. –û—Ç–∫—Ä—ã—Ç–∞ –¥–ª—è —Å–æ—Ç—Ä—É–¥–Ω–∏—á–µ—Å—Ç–≤–∞. –®–∞–Ω–æ–≤–Ω—ñ –¥—Ä—É–∑—ñ! –ü—Ä–æ –¥–∞—Ç—É –±—É–¥–µ –ø–æ–≤—ñ–¥–æ–º–ª–µ–Ω–æ –ø—ñ–∑–Ω—ñ—à–µ. –¢—Ä–µ–Ω–µ—Ä –û–∫—Å–∞–Ω–∞ –ë—ñ–ª–æ—É—Å - –∫–æ–Ω—Å—É–ª—å—Ç–∞–Ω—Ç –∑ –æ—Ä–∞—Ç–æ—Ä—Å—å–∫–æ—ó –º–∞–π—Å—Ç–µ—Ä–Ω–æ—Å—Ç—ñ. –ü–µ—Ä–µ–º–æ–∂–Ω–∏—Ü—è –º—ñ–∂–Ω–∞—Ä–æ–¥–Ω–∏—Ö –∫–æ–Ω–∫—É—Ä—Å—ñ–≤ –æ—Ä–∞—Ç–æ—Ä—ñ–≤. –ü—Ä–µ–¥—Å—Ç–∞–≤–ª—è–ª–∞ –£–∫—Ä–∞—ó–Ω—É –Ω–∞ –º—ñ–∂–Ω–∞—Ä–æ–¥–Ω–∏—Ö —Å—Ü–µ–Ω–∞—Ö –≤ –†—É–º—É–Ω—ñ—ó —Ç–∞ –°–ª–æ–≤–∞—á—á–∏–Ω—ñ.</p>
